import * as React from 'react';

// Wrapper
import { HostSection } from '../../host/wrapper/HostSection';

// Functions
import { SeamlessPaymentCard } from '../functions/SeamlessPaymentCard';

export const SeamlessPayments = () => {
  return (
    <HostSection title='Seamless payments'>
      <div className='flex'>
        <SeamlessPaymentCard title='List your space for free'></SeamlessPaymentCard>
        <SeamlessPaymentCard title='Receive a booking' />
        <SeamlessPaymentCard title='Get paid after check-in' />
      </div>
    </HostSection>
  );
};
